--students number: 122000

-- Get random complexity level
create or replace function get_random_complexity()
    returns complexity
    language plpgsql
as
$$
    declare
        a int;
        complexity_value complexity;
begin
        a = floor(random() * 3 + 1)::int;
    CASE
        WHEN a = 1 THEN
            complexity_value := 'Easy';
        WHEN a = 2 THEN
            complexity_value := 'Medium';
        WHEN a = 3 THEN
            complexity_value := 'Hard';
        END CASE;
        return complexity_value;
end;
$$;

--INSERT 1000 SUBJECTS
do
$$
    declare
        i record;
    begin
        for i in 1..1000 loop
                values (md5(random()::text), md5(random()::text), get_random_complexity());
            end loop;
    end;
$$;

--RANDOMLY GENERATE 1_000_000 exam results
do
    $$
    declare
         i record;
begin
    for i in 1..1000000 loop
values (floor(random() * 122000 + 1)::int, floor(random() * 999 + 1)::int, floor(random() * 5 + 1)::int);
end loop;
end;
$$;

UPDATE student set phone_number = floor(random() * 9999999990 + 1) where id > 0;